import React from 'react';
import List from './List';
import Todo_list from './Todo_list';

const App = () => {

	const Todo = List.map((list) => {
		return(
			<Todo_list list={list} key={list.id} />
			)
		})

	return(
	<div>
		{Todo}
	</div>
	)

}

export default App;
